import { useEffect, useState } from 'react'
import data from '../data.json'




const JobCard = () => {
  const [jobs, setJobs] = useState([])

  useEffect(() => {
    setJobs(data)
    console.log(data)
  }, [])



  return (
    <div className='job-cards'>
      {jobs.map((job) => {
        return (
          <div key={job.id}>
            <div className='job-top-description'>
              <p>{job.company}</p>
              <p>{job.new ? 'NEW' : null}</p>
              <p>{job.featured ? 'FEATURED' : null}</p>
            </div>
            <h1>{job.position}</h1>
            <div className='job-bottom-description'>
              <p>{job.postedAt}</p>
              <p>{job.contract}</p>
              <p>{job.location}</p>
            </div>
          </div>
        )
      })}
    </div>
  )
}

export default JobCard
